import { Button } from '@material-ui/core';
import React from 'react';
const Todolist=()=>{ 
    return(
    <>
      <div className='Main_div'>
      <h1>TODO LIST</h1>
      <div className='Items'>
        <input type={"text"} placeholder="Add an Item"/>
        <Button variant="contained" color="primary">
         Ad
        </Button>
    
      </div>
      </div>
    </>);
}
export default Todolist;
